--
-- Table structure for table `products`
--

DROP TABLE IF EXISTS `products`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `products` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '商品标题',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '商品描述',
  `image` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '商品主图URL',
  `images` json DEFAULT NULL COMMENT '商品轮播图）（json格式）',
  `on_sale` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否在售',
  `rating` double(8,2) NOT NULL DEFAULT '5.00' COMMENT '评分 （0-5）',
  `sold_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `review_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '评论数',
  `price` decimal(10,2) NOT NULL COMMENT '商品价格',
  `category_id` bigint(20) unsigned NOT NULL COMMENT '所属分类id',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态：1.正常 2.下架 3.预售',
  `slug` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'SEO友好的URL标识',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `is_hot` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否热门推荐',
  `discount_start_time` timestamp NULL DEFAULT NULL COMMENT '折扣开始时间',
  `discount_end_time` timestamp NULL DEFAULT NULL COMMENT '折扣结束时间',
  `discount` decimal(5,2) DEFAULT NULL COMMENT '折扣比例 （如0.85表示85折）',
  `is_new` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否新品上市',
  PRIMARY KEY (`id`),
  UNIQUE KEY `products_slug_unique` (`slug`),
  KEY `products_category_id_foreign` (`category_id`),
  CONSTRAINT `products_category_id_foreign` FOREIGN KEY (`category_id`) REFERENCES `product_categories` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=255 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

